var findShortestSubArray = function (nums) {
    let maxNum = 0
    let maxNumC = []
    let res = Infinity
    let unucArr = Array.from(new Set(nums))
    for (let i = 0; i < unucArr.length; i++) {
        let arrLen = nums.filter(x => x === unucArr[i]).length
        if (arrLen > maxNum) {
            maxNum = []
            maxNumC = []
            maxNum = arrLen
            maxNumC.push(unucArr[i])
        } else if (arrLen === maxNum) {
            maxNumC.push(unucArr[i])

        }
    }

    for (let i = 0; i < maxNumC.length; i++) {

        if (nums.lastIndexOf(maxNumC[i]) - nums.indexOf(maxNumC[i]) + 1 < res) {
            res = nums.lastIndexOf(maxNumC[i]) - nums.indexOf(maxNumC[i]) + 1
        }
    }
    return res

};

